int ssproto_manycall_check(ssproto_t *many,int limit,VCEI64 time)
{
  VCEI64 currenttime=vce_get_current_utime();
  many->count++;
  while(many->next<currenttime)
  {
    many->count--;
    if(many->count==0)
    {
      many->next=currenttime+time;
      break;
    }
    many->next+=time;
  }
  if(many->count>limit)
  {
    many->count=limit;
    return -1;
  }
  return 0;
}
